import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import FakeNewsAnalyzer from "./components/FakeNewsAnalyzer"; // Correct import path
import GamePage from "./components/GamePage"; 

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<FakeNewsAnalyzer />} />
        <Route path="/game" element={<GamePage />} />
      </Routes>
    </Router>
  );
};

export default App;
